import React from 'react';
import styled from 'styled-components';

const HeaderWrapper = styled.header`
  background-color: #f8e1e8;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  color: #333;
  font-family: 'Montserrat', sans-serif;
`;

const Logo = styled.div`
font-size: 1.8em;
font-weight: bold;
color: #d81b60;
`;

const Nav = styled.nav`
ul {
    display: flex;
    list-style-type: none;
    li {
    margin: 0 15px;
    cursor: pointer;
    font-size: 1.2em;
    color: #555;
    }
}
`;

const Header = () => {
return (
    <HeaderWrapper>
    <Logo>Cosmetics Store</Logo>
    <Nav>
        <ul>
        <li>Home</li>
        <li>Catalog</li>
        <li>Cart</li>
        </ul>
    </Nav>
    </HeaderWrapper>
);
};

export default Header;
